  \"2016-05-25T00:52:43.476504\",\n\t\"name\": \"global-positioning-system\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A space-base radio positioning, navigation,
  and time-transfer system. The system provides highly accurate position and velocity
  information, and precise time, on a continuous global basis, to an unlimited number
  of properly equipped users. The system is unaffected by weather, and provides a
  worldwide common grid reference system. The GPS concept is predicated upon accurate
  and continuous knowledge of the spatial position of each satellite in the system
  with respect to time and distance from a transmitting satellite to the user. The
  GPS receiver automatically selects appropriate signals from the satellites in view
  and translates these into three-dimensional position, velocity, and time. System
  accuracy for civil users is normally 100 meters horizontally.Approval has been granted
  for properly certified GPS avionics to be used as a primary means of navigation
  in oceanic airspace and in certain remote areas.\",\n\t\"license_title\": \"Other
